INSERT INTO `projects` VALUES (1,'PNEUMATIC BUMPER AUTOMATIC','This system is consists of IR transmitter and Receiver circuit, Control Unit, Pneumatic bumper system. The IR sensor is used to detect the obstacle. There is any obstacle closer to the vehicle (with in 4 feet), the control signal is given to the bumper activation system. The pneumatic bumper system is used to product the man and vehicle. This bumper activation system is only activated the vehicle speed above 40-50 km per hour. This vehicle speed is sensed by the proximity sensor and this signal is given to the control unit and pneumatic bumper activation system.','Mechanical  project',262,'AUTOMATIC PNEUMATIC BUMPER-MECHANICAL ENGINEERING PROJECT REPORT.doc'),(2,'Download Online Examination System Project in PHP','Online Examination system is the process of conducting exam online.This project provide accurate and flexible manner of conducting exam online.This Project provides more accurate and efficient way to take exam.It also provides flexibility  to the user as one can give the exam at home.This is a one of the good project for final year student.','PHP,MySql',3,'Online_Examination_PHP.zip'),(3,'Download Website Copier Project in JAVA','Website Copier is a application to download complete website for Offline browsing.It is similar to HTTRACK.Complete source code is written in java with complete source code and report.author have written excellent java code with Java.Net package.Good academic project developed in java.','Java',476,'minicopier-master.zip'),(4,'Online Pharmacy Management in JSP','Free Download Project with complete source code in JSP,Java with Oracle 10g as a Database.This project is developed for a Pharmacy which want to manage routine operation.Pharmacy management system is developed in Java Server Pages with netbeans as a IDE. It has a good GUI with HTML and CSS.download complete project with source code and report in JSP.','Java,JSP,AJAX,HTML,CSS,Netbeans',148,'Pharmacy-Management-System-JSP.zip'),(5,'Payment Billing System in JSP|Java','Free Download Project with complete source code in JSP,Java with Oracle 10g as a Database.The project titled as â€œPAYMENT BILLING SYSTEM IN JSP â€œis a web based application. An institute  have  different branches at different locations   want to control and maintain the accountant salary and student personal and payment details. software provides facility for reporting  , new student details, payment details ,and modify details of student and salary of the accountant.','Java,JSP,AJAX,HTML,CSS,Netbeans',264,'Payment-Billing system-JSP.zip'),(6,'Face Identification System in Java','To identify any person we need some identification regarding person, which are given by eyewitness. In most cases the quality and resolution of the recorded image segments is poor and hard to identify a face. To overcome this sort of problem we are developing software. Identification can be done in many ways like finger print, eyes, DNA etc. One of the applications is face identification. The face is our primary focus of attention in social inters course playing a major role in conveying identify and emotion. Although the ability to infer intelligence or character from facial appearance is suspect, the human ability to recognize face is remarkable.This project is intended to identify a person using the images previously taken. The identification will be done according the previous images of different persons.Download Face Detection system in Java with source code.','Java,JSP',327,'Face-Detection-System.zip'),(7,'Online E Blogging Platform Developed in Asp.Net','Blogging is one of the Content management system where every one can create a his/her own Blog.This Blog can be created after successful registration.registered User can Edit or Update a blog or write more Blog.Blog can be read by any anonymous user without registration.This project is one of the good project for Final year major project.Download complete project source code in asp.net with MS Sql as a Database and C#.Net as a programming language.','Asp.Net,MS Sql,CSS,HTML,JavaScript,C#.Net',294,'E-Blogging-asp-net-project.zip'),(8,'Document management System in Asp.Net','Digital Documents are increasing very rapidly.To manage and store these documents efficiently,some management system is required.Digital Document Management System provide architectural way of organizing and managing a Digital Documents.Download this project with complete source code in asp.net with report and database.This project follows Object Oriented Design and Good User Interface designed with HTML and CSS.','Asp.Net,MS Sql,CSS,HTML,JavaScript',433,'Digital-Doc-Mgmnt-Sysm.zip'),(9,'Chat Application in Node Js','Download complete project source code written in server side Javascript NodeJs and Express.This application demonstrate good example of socket programming in nodeJs and Express.Download complete project with complete source code and report for free.','Javascript,Node Js,Express',235,'chat-master.zip'),(10,'Online Live Meeting in Asp.Net','This project is mainly developed for the communication of Employees of organization located at different locations. The project entitled â€œLive Meeting in Asp.Netâ€ set of platform for the project leaders and administrator to send messages to keep constant interaction with the programmers. In the proposed system is the administrator can sit at his system and communicate with the project leaders, programmers and can also maintain the login time, logout time. He can chat about the project going on with both the programmers and project leaders. This project also maintains offline messages. The administrator sees the IP address of the system of project leader/programmer he is interested and chat with the people .The project leader gives the instant report about the project to the administrator. Through this Communication System, Whenever user logs-in into the system then login time is recorded in the administratorâ€™s system automatically. This project makes the most of the tedious and mundane deskwork to minimize. This facilitates the user to concentrate more on the project and less on the managing of these tasks. The software is fully integrated with CRM (Customer Relationship Management) as well as CMS (Content Management System) solution and developed in a manner that is easily manageable, time saving and relieving one from manual works.','Asp.Net,Ms Sql,C#.Net',330,'Live-Meeting-In-Asp.rar'),(11,'Online Production Management System in JSP|Java','Online production management system is a online web application to manage task of production.This application is very useful for companies which are getting their orders of products and then making that particular order.Using this application,they can manage material required or used for production,cost of material,cost of labour work.This application is very useful to make their routine task automated in JSP|Java.Download JSp|Java source code for Online Production Management System.','JSP,Java',395,'Production-Management-Sysetm.zip'),(12,'Intelligent Online Commodity trading System in Asp','This online web application is generated to provide intelligent trading for commodity market.This online web application will provide live rate of commodity.user can also purchase and sell commodity online.account is maintained automatically.Download Online Intelligent commodity trading system in Asp.Net with complete source code and report.','Asp.Net,Ms Sql,C#.Net',433,'intelligent-commodity -trading.rar'),(13,'Online Course Management System','Developing an Integrated Collage Management System initiative is a typically much larger endeavor than that of an instructor-led training (ILT) program. Consider the increased expenses, number of people involved, development time, technological requirements, and delivery options.Download Online Course management system with asp.net.This project includes Database Files in MS Sql,Project Source code in Asp.Net and Report and Presentation of Project.','Asp.Net,Ms Sql,C#.Net',432,'Course-Management-System.rar'),(14,'Office Management System in Asp.Net','This is an intranet web application used to automate tasks related to a typical front-office desk of training centre.Download Asp.Net Project on Office Management System with complete source code.This allows user to log in and add details of batches, students and payments. It also provides search of students, payments report, information about batches and students.','Asp.Net,Ms Sql',310,'Office-Management-System.zip'),(15,'GEO SPATIAL WEB SOLUTION','Local bodies like municipalities need collect different kind of taxes from the citizens.  Every citizen need to pay Water Bills and Electricity Bills to the particular authorities.  Actually a citizen want to pay his municipal tax means he should go to municipal office and collect the necessary bill, pay there only.  Same as water and electricity bills.    This is not an easy job to get all these tax information in different authorities now days.	For that purpose we are developing this application, which can collect the tax information from different authorities based on the house noâ€™s and owner name by using Web Services and stores the data in our own database.  For getting the information regarding taxes citizens need to register first.Download Latest Asp.Net Project for Final year.','Asp.Net,Ms Sql',205,'gEO-sPATIAL-wEB.zip'),(16,'Tourism Management System','A Tourism Management System is a web project which explains about developing an Asp.Net Application in layered architecture. This application has all coding standards in place. This project is developed only for freshers and junior developers. It has Object Oriented Programming which helps Freshers and Junior developers to easily understand how project will be developed any software company.','Asp.Net,Ms Sql',545,'Tourism-Management-System-Asp.rar'),(17,'Network Load Balancing project in Java','Network Load Balancing syst